    }
    function requestData () external{
      require(dataHasBeenRead == true, "ERR: Previous data has not been read!");
      dataIsReady = true;
      dataHasBeenRead = false;
    }

    function copyData () external returns (bytes memory){
      dataHasBeenRead = true;
      dataIsReady = false;
      return encodedData;
    }

    function updateData (uint seed) public {

      uint8[10] memory data = [uint8(seed % 7), uint8(seed % 71), uint8(seed % 17), uint8(seed % 13), uint8(seed % 51), uint8(seed % 12), uint8(seed % 57), uint8(seed % 51), uint8(seed % 42), uint8(seed % 19)];

      encodedData = abi.encode(data);

      commitment = keccak256(encodedData);
    }
}

contracts/Types.sol.content:
pragma solidity ^0.8.18;

contract Types {

    enum MATCH_STAGE {
        DUMMY,
        P1_CREATED_THE_MATCH,
        P2_JOINED_THE_MATCH,
        RANDOM_SEED_FETCHED,
        RANDOM_SEED_RECEIVED,
        COMMITMENTS_FETCHED,
        COMMITMENTS_RECEIVED,
        REVEALS_FETCHED,
        REVEAL_RECEIVED,
        STATE_UPDATE_PERFORMED,
        MATCH_ENDED
    }

    struct PlayerStats {
        uint speed;
        uint skill;
        uint stamina;
    }

    struct MatchInfo {
        uint seed;

        address[] commitmentFunctionConsumer;
        address[] revealFunctionConsumer;

        MATCH_STAGE stage;

        uint stateId;
    }


    struct MatchState {
        uint[] score;
    }

    struct TeamState {
        PlayerStats[] playerStats;
        uint[] xPos;
        uint[] yPos;

        bool hasTheBall;
        uint playerIdWithTheBall;
    }

    struct TeamMove {
        bytes commitment;
        bytes reveal;

        uint[] xPos;
        uint[] yPos;

        bool wantToPass;
        uint receivingPlayerId;

        bool wantToShoot;
    }


    struct ProgressionState {
        bool ballWasWon;
        uint ballWasWonByTeam;

        bool interceptionOccured;
        uint interceptionAchievedByTeam;
        uint[] ballXPos;
        uint[] ballYPos;

        bool goalWasScored;
        uint goalWasScoredByTeam;

        TeamState[] teamState;
    }

}

